import React  from 'react'
import { Link } from 'react-router-dom'
import "./Table.css"

const Table = () => {
    const Users = [
        {
          id:1,
          profilePicture: "data:image/jpeg;base64,",
          tablename: "",
        },
        {
          id:2,
          profilePicture: "data:image/jpeg;base64,",
          tablename: "2",
        },
        {
          id:3,
          profilePicture: "data:image/jpeg;base64,",
          tablename: "3",
        },
        {
          id:4,
          profilePicture: "data:image/jpeg;base64,",
          tablename: "4",
        },
    ]
   
    
  return (
    <div className='wrapper'>
    <h2 style={{textAlign:"center"}}>Welcome to Dine in Resturant</h2>
    <div className='table'>{Users&& Users.map((user)=> (
        <div className='single'>
        <p>Table Number{user.tablename}</p>
        <img src={user.profilePicture} alt='tables' width="250" height="250" />
        <Link className='linkScan' to="/scanner">Scan and order</Link>
        </div>
    ))}</div>
    </div>
  )
}

export default Table